Files containing the handler implementation for getOrders (paths relative to project root):

- controllers/orderController.js

Explanation
- I searched the repository for occurrences of the symbol "getOrders" (using ripgrep). That showed usage/import in routes/orderRoutes.js and the implementation in controllers/orderController.js.
- The implementation is defined in controllers/orderController.js as:
  const getOrders = asyncHandler(async (req, res) => {
    const orders = await Order.find({}).populate('user', 'id name');
    res.json(orders);
  });
- routes/orderRoutes.js imports and mounts getOrders on GET / (router.route('/').get(..., getOrders)), confirming that controllers/orderController.js is the file providing the handler logic.
- No other files define the getOrders handler (search results only showed controllers/orderController.js as the implementation).
